import React, { FC } from 'react';
import { NavLink } from 'react-router-dom';

import routePaths from '../../router/routePaths';

import style from './Navbar.module.scss';

const Navbar: FC = () => {
  return (
    <div className={style.navBarWrapper}>
      <h2>Hotel Management System</h2>
      <div className={style.sideNav}>
        <NavLink to={routePaths.myAccount}></NavLink>
        <NavLink to={routePaths.userManagement}></NavLink>
        <NavLink to={routePaths.hotelManagement}></NavLink>
        <NavLink to={routePaths.bookings}></NavLink>
        <NavLink to={routePaths.logout}></NavLink>
      </div>
    </div>
  )
};

export default Navbar;
